    def __make_request(self, end_point, payload):
        key = str(payload)
        response = self.flight_aware_cache.get(key) if self.cache_enabled else None
        if (response == None):
            print("Cache Miss!")
            response = requests.get(self.FXML_URL + end_point, params=payload, auth=self.authentication_info)

            if self.cache_enabled:
                self.flight_aware_cache.add(key, response)
        else:
            print("Cache Hit!")

        if response.status_code == 200:
            decodedResponse = response.json()
            return decodedResponse
        else:
            print("Unable to retrieve flight aware data", response.text)
            return RuntimeError("Unable to retrieve flight aware data")

